# pylint: disable=line-too-long

import unittest

from src.leet_code.minimum_window_substring import Solution

STRING1 = ""
STRING2 = ""

EXPECTED = ""


class TestMinimumWindowSubstring(unittest.TestCase):
    def test_min_window(self):
        solution = Solution()
        cases = (
            ("BANCADOBECODE", "ABC", "BANC"),
            ("ADOBECODEBANC", "ABC", "BANC"),
            ("a", "a", "a"),
            ("a", "aa", ""),
            ("A..A.BA.B..B", "AB", "BA"),
            ("A..A.BA.B..B", "AAB", "A.BA"),
            ("A..A.BA.B..B", "ABB", "BA.B"),
            ("A..A.BA.B..B", "ABAB", "A.BA.B"),
            (STRING1, STRING2, EXPECTED),
        )
        for string1, string2, expected in cases:
            with self.subTest(f"{string1, string2} --> {expected}"):
                actual = solution.minWindow(string1, string2)
                self.assertEqual(actual, expected)


if __name__ == "__main__":
    runner = unittest.TextTestRunner(verbosity=2)
    unittest.main(testRunner=runner)
